import React from 'react'
import ProfileCard from './ProfileCard/ProfileCard'
import "./ProfileSection.css";
//  import lc from '../images/lc.png'

function ProfileSection() {
  return (
    <div className="profile-section-container">
        <ProfileCard props={{title:"LeetCode",imgUrl:"./images/lc.png",profileUrl:"https://leetcode.com/tush27/"}}/>
        <ProfileCard props={{title:"GeeksForGeeks",imgUrl:"./images/lc.png",profileUrl:"https://auth.geeksforgeeks.org/user/ttusharbe19/practice/"}}/>
        <ProfileCard props={{title:"Coding Ninjas",imgUrl:"./images/lc.png",profileUrl:"https://www.codingninjas.com/codestudio/profile/91453a0d-d66f-4671-88e2-3d7368c7390a"}}/>
    </div>
  )
}

export default ProfileSection
